import React, { Component, Fragment } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Articules from './components/Articules';
import './App.css';

function App() {
  return (
    <Router>
      <Fragment>
        <Articules />
      </Fragment>
    </Router>
  );
}

export default App;
